description:
These are LuaJIT 2.0.2 binaries for Windows.

The binaries have been built from LuaJIT git HEAD (commit 21af151 on June 3, 2013 at 21:16:17 GMT+0200) with /DLUAJIT_ENABLE_LUA52COMPAT option (see http://luajit.org/extensions.html#lua52).

----------------
